def main():
    input_data = sys.stdin.readline().strip().split(' ')
    n,m = int(input_data[0]), int(input_data[1])
    result = [[0 for i in range(m)] for j in range(n)]
    for j in range(n):
        result[j] = [int(i) for i in input().split(' ')]
    ans = []
