        for j  in range(0, m, 2):
            temp.append((result[i][j] + result[i][j+1] + result[i + 1][j] + result[i + 1][j + 1] )// 4) 
        ans.append(temp)
    for i in range(n // 2):
        for j in range(m // 2):
            print(ans[i][j], end=" ")
        print("")



